import './App.css';
import { MapContainer, TileLayer, Marker, Circle } from 'react-leaflet';
import L from 'leaflet';

function issIcon() {
  return(
    L.icon({
      iconUrl: require('http://open-notify.org/Open-Notify-API/map/ISSIcon.png')
    })
  )
}

function App() {
  return (
      <header className="ISS Tracker">

        <MapContainer center={[51.505, -0.09]} zoom={6} scrollWheelZoom={false}>
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />

          <Circle center={[51.505, -0.09]} radius={80000} color={'red'} opacity={0.3}/>
          <Marker position={[51.505, -0.09]} icon={issIcon}>

          </Marker>
        </MapContainer>

      </header>
  );
}

export default App;
